import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import RegistroInicioSesion from './components/RegistroInicioSesion';
import RegistroEstadoAnimo from './components/RegistroEstadoAnimo';
import HistorialAnimo from './components/HistorialAnimo';
import Recomendaciones from './components/Recomendaciones';
import ContenidoEducativo from './components/ContenidoEducativo';
import PerfilUsuario from './components/PerfilUsuario';

function App() {
  return (
    <Router>
      {/* Elimina o comenta esta sección completa */}
