      <Routes>
        <Route path="/" element={<RegistroInicioSesion />} />
        <Route path="/registro-estado-animo" element={<RegistroEstadoAnimo />} />
        <Route path="/historial-animo" element={<HistorialAnimo />} />
        <Route path="/recomendaciones" element={<Recomendaciones />} />
        <Route path="/contenido-educativo" element={<ContenidoEducativo />} />
        <Route path="/perfil" element={<PerfilUsuario />} />
      </Routes>
    </Router>
  );
}

export default App;
